 // src/Welcome.js
import React from 'react';

const Welcome = () => {
  return (
    <div className="App">
      <div className="header">
        <h1>Welcome to the Daily Quotes App!</h1>
      </div>
      <div className="main-content">
        <p>Thank you for setting up your notification time. You'll receive your daily quotes as scheduled!</p>
      </div>
      <div className="footer">
        {/* Add more navigation or actions if needed */}
      </div>
    </div>
  );
};

export default Welcome;
